import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

const Nav: React.FC = () => {
  return (
    <>
      <Link to='/'>
        <Profile>Profile</Profile>
      </Link>
    </>
  );
};

const Profile = styled.button`
  padding: 10px;
  font-size: 1rem;
  color: white;
  background-color: #333;
`;

export default Nav;
